(22, 128, 33, 'no tengo drama me interesa tengo mis datos en mi perfil', '', '2013-10-03 00:11:37', '0000-00-00 00:00:00', '1'),
(23, 212, 26, 'Si el trabajo es para realizar u alministrar una tienda online, me interesa. Me gustaría saber exactamente como sería el manejo. Saludos', '', '2013-10-03 02:01:43', '0000-00-00 00:00:00', '1'),
(24, 213, 26, 'Me interesa el trabajo. Por favor contáctenme. Saludos.', '', '2013-10-03 02:03:41', '0000-00-00 00:00:00', '1'),
(25, 243, 26, 'como es el trabajo?', '', '2013-10-09 17:41:23', '0000-00-00 00:00:00', '1'),
(26, 221, 19, 'Me acabo de postular, me encantaría formar parte! Espero novedades!', '', '2013-10-15 14:45:13', '0000-00-00 00:00:00', '1'),
(27, 270, 42, 'Los cortes ya están decididos? es sólo carne o algo más?', 'Carne y achuras. Tenes experiencia de asado?', '2013-10-24 20:36:55', '2013-10-24 20:50:40', '1'),
(28, 270, 42, 'Bastante, amo hacer el fuego de distintas formas (leña o carbón) y soy siempre el que se ofrece a hacerlo, mañana y el sábado tengo ya arreglado para hacer asado. Fijate si te interesa me puedo ir hasta allá y lo hago en aprox 2hs. \nTengo utensillos de asador y puedo hacer papas, cebollas asadas y alguna que otra cosa mas si les interesa agregar., saludos.', 'Pero el trabajo sería no sólo hacer el asado sino luego servir las bandejas con carne.', '2013-10-24 20:56:08', '2013-11-07 20:57:17', '1'),
(29, 270, 42, 'Perfecto, ésa es la parte fácil :D. Avisame si estás interesada que me encargue de hacerlo.', 'No venís por san Isidro mañana por casualidad, así te conozco?', '2013-11-07 21:02:03', '2013-11-07 21:03:13', '1'),
(30, 270, 42, 'Mmm, mañana tengo unos compromisos q me imposibilitan.. pero si queres el lunes o martes en algun momento nos encontramos', '', '2013-11-07 21:07:31', '0000-00-00 00:00:00', '1'),
(31, 270, 47, 'Buenas tardes, no solamente puedo realizar la presentación en filminas, sino que puedo mejorar la misma con otro programa y compatible con cualquier pc. Avise si está interesado, soy Diseñador Gráfico.', 'Me interesa, la idea es diseño, imágenes y algo del texto', '2013-11-13 17:34:23', '2013-11-13 17:41:32', '1'),
(32, 270, 47, 'perfecto cuando quieras nos juntamos, las imágenes las tenes vos? el texto?', 'No tengas imágenes, si tenemos la idea, concepto y un video deapertura', '2013-11-13 18:01:54', '2013-11-13 19:53:08', '1'),
(33, 270, 47, 'Bien, querés que nos juntemos? acepta mi postulacion', '', '2013-11-13 20:28:58', '0000-00-00 00:00:00', '1'),
(34, 270, 47, 'y? alguna resolucion con respecto al trabajo?', '', '2013-11-17 20:49:56', '0000-00-00 00:00:00', '1'),
(35, 314, 49, 'Hola!\nTe hago un par de consultas:\n- La fecha del focus group es el 19 de Noviembre o de Diciembre?\n- Cuál es la remuneración?\nGracias,\nVictoria', 'Fe de erratas, 19 de Diciembre. La remuneración es de $420 y tendrías que pagarle un fee de $42 a SoloChanguitas por hacerte el link con nosotros.', '2013-11-25 14:18:19', '2013-11-25 16:18:30', '1'),
(36, 314, 49, 'Perfecto!\nYa me postulé!\nMuchas gracias', '', '2013-11-25 16:56:02', '0000-00-00 00:00:00', '1'),
(37, 371, 48, 'que tipo de maquillaje artistico? animales, mariposas, etc? deberia llevar mis propias pinturas?', '', '2013-11-28 13:54:12', '0000-00-00 00:00:00', '1'),
