(40, 260, 53, 'Hola que tipo de animaciones son las que necesitas?', '', '2013-12-18 12:48:03', '0000-00-00 00:00:00', '1'),
(41, 114, 50, 'Hola soy un profesional especializado en marketing y desarrollo web, tengo gran experiencia en desarrollo posicinamiento web como tambien marketing y ventas en redes sociales. Me he postulado para su proyecto.', '', '2013-12-19 16:05:16', '0000-00-00 00:00:00', '1'),
